import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import logo from "../assets/pbj-logo.png"; // Ensure your logo is in assets folder

const PBJNavbar = () => {
  return (
    <Navbar expand="lg" className="custom-navbar">
      <Container>
        {/* Left Side - Navigation Links */}
        <Navbar.Toggle aria-controls="navbar-nav" />
        <Navbar.Collapse id="navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/about">About</Nav.Link>
            <Nav.Link as={Link} to="/services">Services</Nav.Link>
            <Nav.Link as={Link} to="/projects">Projects</Nav.Link>
            <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>

        {/* Right Side - Logo & Brand Name */}
        <Navbar.Brand className="d-flex align-items-center">
          <img src={logo} alt="PBJ Fire Logo" className="pbj-logo" />
          <span className="pbj-brand">PBJ Fire</span>
        </Navbar.Brand>
      </Container>
    </Navbar>
  );
};

export default PBJNavbar;
